@Wendler34 Ok fair we have had more adjustments, but hard to get excited about just old maps being brought forward and them fixing maps. 

I guess saying "a renewed focus" means more than just finally doing something. 

Just want more info up front I think would help

@EnigmaAMC @x_PDC_x It is the point, it boils down to you are upset worse players are hitting legend in a VIDEO GAME. 

Either you have fun playing the game or you don't, rank in a non-comp game doesn't matter either way. 

I'd expect more from LR than shaming of players who didn't "earn it"

@EnigmaAMC @x_PDC_x So to go off that, why not have a season here where everyone has a chance to obtain the gun? 

I said at the start of season I had a feeling that the MM will get changed to a more strict ranking next season.

Hence why I try to understand why so many "pvp experts" have been mad.

@EnigmaAMC @x_PDC_x But in your thought process earning it means they have to play a full stack of unbroken players? 

People are earning it themselves now, even if it means they  play people at their skill. 

Treating "comp" like flawless trials, using ornaments for top reward would be best imo.

